function Jacket(props) {
  let startCount = props.startCount;
  let IdealCount = props.IdealCount;
  return (
    <div id="jacket">
      <h1>Jackets</h1>
      <h2>CurrentCount : {startCount}</h2>
      <h2>IdealCount : {IdealCount}</h2>
    </div>
  );
}

export default Jacket;
